import React from 'react';

import '../App.css';

{/* About page */}

function About() {
    return (
        <div>
            <p className="App-style">Since 2019, we have been providing users and customers the best experience. <br></br>
            At ToUpper LLC, we pride and distinguish ourselves by using the most modern <br></br>
            technology when creating applications for our clients. We help our clients to<br></br>
            ensure that their business succeeds and meets their goals by providing the most <br></br>
            elegant and easy to use application for their customers.

            </p>

            <p className="App-style"> During our process, we organize and make sure that your application is met within <br></br>
             a timely manner. In order to ensure that your application is the best out there, we test <br></br>
             our applications to assure for security, bugs, and any other issues that may come your <br></br> 
             way. We will also be happy to publish your application through the Web or Apple/Google Play store. </p>

            <p className="App-style">  We know creating a website isn't easy, so let us help. Please, contact us and <br></br>
             provide any questions or comments you may have! We will be happy to provide a <br></br>
             free first consultation.</p>
      </div>
    );
}

export default About;
